INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (1, 169, 1, NULL, 1, 24, 'Creation', 'In six days God created the heavens and the earth. On day one He made light and separated it from darkness. On day two He set the sky above the earth''s surface. On day three He gathered the seas from the dry land and made vegetation grow. On day four He created the sun, moon, and stars. On day five He created water creatures and birds. And on day six He created land creatures and people.', NULL, NULL, NULL, NULL, -10010, NULL, NULL, NULL, 0, 0, NULL, NULL, 51);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (2, 169, 2, NULL, 1, 24, 'The Fall of Man', 'Adam and Eve ate the forbidden fruit in the garden of Eden, resulting in the fall of humanity.', NULL, 'Eden', NULL, NULL, -10009, NULL, NULL, NULL, 0, 0, NULL, NULL, 189);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (3, 169, 3, NULL, 1, 24, 'The Flood', 'By faith, Noah obeyed God, built an ark, and saved his family from the great flood.', NULL, 'ark, Noah', NULL, NULL, -10008, NULL, NULL, NULL, 0, 0, NULL, NULL, 190);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (4, 169, 4, NULL, 1, 3, 'Tower of Babel', 'Everyone settled in Shinar and proudly built a tower, but God scattered them abroad.', NULL, 'Shinar', NULL, NULL, -10007, NULL, NULL, NULL, 0, 0, NULL, NULL, 194);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (5, 169, 5, NULL, 1, 3, 'Sumerians', 'Sumerians are famous for their ziggurats, wheeled transportation, invention of the abacus, and story of Gilgamesh.', 'They founded farming, trading, and cuneiform writing in Southern Mesopotamia.', 'ziggurats, abacus, Gilgamesh, cuneiform writing', 1, -4000, NULL, 1, -1700, NULL, 1, 0, 1, NULL, 185);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (6, 169, 6, NULL, 1, 35, 'Egyptians', 'Ancient Egyptians are famous for their pyramids, hieroglyphic writing, and elaborate art.', 'They farmed along the Nile River and developed algebra, geometry, engineering, and building techniques.', 'pyramids, hieroglyphic writing', 1, -3100, NULL, 1, -500, NULL, 1, 0, 2, NULL, 63);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (7, 169, 7, NULL, 1, 52, 'Elamites & Aryan Tribes', 'Elamites and many tribal groups like Medes, Parthians, and Persians wandered and settled the land southeast of Mesopotamia.', NULL, 'Medes, Parthians, Persians, Mesopotamia', 1, -3000, NULL, NULL, NULL, NULL, 1, 0, NULL, NULL, 64);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (8, 170, 1, NULL, 1, 41, 'Phoenicians & Canaanites', 'Phoenicians were Eastern Mediterranean seafaring traders, ship-builders, and dye-makers.', NULL, 'seafaring traders, ship-builders, dye-makers', 1, -3000, NULL, 0, -539, NULL, 1, 0, NULL, NULL, 159);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (9, 170, 2, NULL, 1, 23, 'Indus Valley Civilization', 'Ancient Indus Valley civilization was known for its baked brick houses, advanced water systems, and metallurgy.', NULL, 'baked brick houses', 1, -3000, NULL, 1, -1300, NULL, 1, 0, NULL, NULL, 95);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (10, 170, 3, NULL, 2, 37, 'Minoans & Mycenaeans', 'The Minoans on Crete created great palaces and art. The Mycenaeans founded Greek civilization and legend.', NULL, 'Crete, Greek', 1, -2700, NULL, 1, -1100, NULL, 1, 0, NULL, NULL, 136);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (11, 170, 4, NULL, 1, 50, 'Amorites', 'The Amorites were semi-nomadic people who dwelt from Mesopotamia to the Mediterranean.', NULL, 'Mesopotamia', 1, -2400, NULL, 1, -1600, NULL, 1, NULL, NULL, NULL, 13);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (12, 170, 5, NULL, 1, 3, 'Akkadian Empire', 'The brief Akkadian Empire began with the legendary King Uruk and Sargon the Great, and fell to famine and invasion.', NULL, 'Akkad, Akkadian, Uruk, Sargon', 1, -2334, NULL, 1, -2150, NULL, 0, 0, NULL, NULL, 7);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (13, 170, 6, NULL, 1, 41, 'Israelites', 'Israel began when God called Abraham from Ur, in Sumer, to Canaan. Descendants of Isaac and Jacob became the tribes of Israel.', 'These tribes included Levi, Judah, Naphtali, Ephraim, and Benjamin.', 'Abraham, Ur, Sumer, Canaan, Isasc, Jacob, Levi, Judah, Naphtali, Ephraim, Benjamin', 1, -2100, NULL, 0, -63, NULL, 1, NULL, NULL, NULL, 102);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (14, 170, 7, NULL, 1, 3, 'Assyrians', 'Ancient Assyrian merchants traded, became wealthy, then engaged with the most powerful Mesopotamian empires for millennia.', NULL, 'Mesopotamia', 1, -1900, NULL, 0, -612, NULL, 1, NULL, NULL, NULL, 17);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (15, 171, 1, NULL, 1, 3, 'Hammurabi''s Babylonian Empire', 'Hammurabi, who was an Amorite, united all of Mesopotamia into the first Babylonian Empire through diplomacy, war, and the Code of Hammurabi.', NULL, 'Amorite, Mesopotamia, Code', 1, -1795, NULL, 1, -1750, NULL, 0, NULL, NULL, NULL, 84);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (16, 171, 2, NULL, 1, 35, 'Hyksos conquer Egypt', 'The Hyksos conquered Egypt, ending Egypt’s “Middle Kingdom”, known as the “Classical Age” of Egypt.', NULL, 'Middle Kingdom, Classical Age', 1, -1750, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, 92);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (17, 171, 3, NULL, 1, 26, 'Hittites', 'The Hittites, descendants of Noah''s son Ham, ruled Asia Minor and occasionally conquered lands as far south as Mesopotamia and Egypt.', NULL, 'Ham, Asia Minor, Mesopotamia, Egypt', 1, -1700, NULL, 1, -1200, NULL, 1, NULL, NULL, NULL, 88);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (18, 171, 4, NULL, 1, 39, 'Hinduism established', 'Hinduism is a variety of beliefs about the "Oneness" expressing itself in many forms. It evolved from ancient India and is represented in the Vedas, Upanishads, and Bhagavad Gita.', NULL, 'Oneness, India, Vedas, Upanishads, Bhagavad Gita', 1, -1700, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 87);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (19, 171, 5, NULL, 1, 39, 'Shang Dynasty', 'The Shang Dynasty marked the origin of Chinese culture. Writing, bronze casting, and distinctive religious rituals and art emerged.', NULL, 'China', 1, -1600, NULL, NULL, -1046, NULL, NULL, NULL, NULL, NULL, 175);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (20, 171, 6, NULL, 1, 35, '"New Kingdom" of Egypt', 'Egyptians drove out the Hyksos and Nubians under Ahmose I to begin a 500 year period of famous culture, pharaohs, and great pyramids.', NULL, 'Hyksos, Nubia, Ahmose, pharaohs, pyramids', 1, -1570, NULL, NULL, -1069, NULL, 0, NULL, NULL, NULL, 4);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (21, 172, 1, NULL, 1, 41, 'Moses & Israel’s Exodus', 'Moses, an Israelite, was raised up under Pharaoh''s household until he fled to Midian, where God called him to participate in the Plagues and the freeing of Israel from Egypt.', NULL, 'Midian, plagues, Egypt', 1, -1290, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, 140);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (22, 172, 2, NULL, 1, 41, 'Israel occupies Canaan', 'Israel, led by Joshua, invaded Canaan lands after spending forty years in the Sinai desert following their Exodus from Egypt.', NULL, 'Joshua, Sinai, desert, exodus, Egypt', 1, -1250, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 100);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (23, 171, 7, NULL, 2, 37, 'Trojan War', 'The Trojan War, made famous in Homer’s Iliad, pitted the Mycenaean Greeks against the Hittites in ten years of war, ending in the epic siege of Troy.', NULL, 'Homer, Iliad, Mycenea, Greek, Hittite, Troy', 1, -1334, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 195);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (24, 172, 3, NULL, 3, 32, 'Mayan Olmec Civilization', 'Olmec Civilization, known for their giant sculptures and vast architectures, was the first of the Mayan Civilizations.', NULL, NULL, 1, -1200, NULL, 1, -400, NULL, 1, NULL, NULL, NULL, 131);
INSERT INTO event (id, cw, seq, subseq, cycle_focus, region, name, primary_sentence, secondary_sentence, keywords, start_circa, start, fake_start_date, end_circa, "end", tie, people_group, the, extent, period, qr_key) VALUES (25, 172, 4, NULL, 2, 37, 'Greek Dark Ages', 'The Greek Dark Ages began with the fall of the Mycenaean civilization, after which writing was abandoned, so we have no record of 300 years of Greek life.', NULL, 'Mycenae', 1, -1100, NULL, 1, -800, NULL, NULL, NULL, NULL, NULL, 80);
