INSERT INTO instructions (id, text) VALUES (23, 'Master Timeline, History, and Geography grammar for weeks {chapters}');
INSERT INTO instructions (id, text) VALUES (24, 'Read Genesis 11:27 – 15; Psalm 40');
INSERT INTO instructions (id, text) VALUES (25, 'Watch <a href="https://www.youtube.com/watch?v=7TRQfei7JoI">Prager''s 10-Commandment series</a>');
INSERT INTO instructions (id, text) VALUES (26, 'Watch movie: Joseph (Turner Pictures, 2005, 185 min., from “The Bible Collection” series)');
INSERT INTO instructions (id, text) VALUES (27, 'Read <a href="https://www.baslibrary.org/biblical-archaeology-review/45/3/5">“Who Were the Assyrians”</a> in the May/June 2020 Biblical Archaeology Review');
INSERT INTO instructions (id, text) VALUES (28, 'Begin reading {chapters}');
INSERT INTO instructions (id, text) VALUES (29, 'Read for fun');
INSERT INTO instructions (id, text) VALUES (30, 'Choose an issue from {items}');
INSERT INTO instructions (id, text) VALUES (31, 'Complete an ANI with {items} items per column');
INSERT INTO instructions (id, text) VALUES (32, '... questions from the <b>Five Common Topics worksheet, page 9</b>');
INSERT INTO instructions (id, text) VALUES (33, 'Complete an ANI with {items} items per column, using...');
INSERT INTO instructions (id, text) VALUES (34, '... <u>and</u> the <b>Comparison I template, page 23</b>');
INSERT INTO instructions (id, text) VALUES (35, 'Use <b>Essay One Arrangement, pages 4-5</b> to...');
INSERT INTO instructions (id, text) VALUES (37, 'Sort your ANI, refer to <b>pages 10-12</b> for guidance');
INSERT INTO instructions (id, text) VALUES (38, 'Use <b>Essay Two Arrangement B worksheet, pages 13-14</b> to...');
INSERT INTO instructions (id, text) VALUES (39, 'Use <b>A Guide to Exordium, page 24</b>, to develop your exordium');
INSERT INTO instructions (id, text) VALUES (40, 'Use <b>Essay Three Arrangement B worksheet, pages 25-26,</b> to...');
INSERT INTO instructions (id, text) VALUES (41, 'Bring your outline to class');
INSERT INTO instructions (id, text) VALUES (42, 'Write your <b>Rudimentary Persuasive Essay (Essay One Checklist, page 108)</b> from your outline');
INSERT INTO instructions (id, text) VALUES (43, '... using <b>Parallelism I: Words, pages 16-19</b> to add parallelism');
INSERT INTO instructions (id, text) VALUES (44, 'Write your <b>Introductory Persuasive Essay (Essay One Checklist, page 109)</b> from your outline');
INSERT INTO instructions (id, text) VALUES (45, '... using <b>Basic Editing: Verbs, pages 29-31</b> to add strong verbs');
INSERT INTO instructions (id, text) VALUES (46, 'Write your <b>Basic Persuasive Essay (Essay Three Checklist, page 110)</b> from your outline');
INSERT INTO instructions (id, text) VALUES (47, 'Bring your essay to class');
INSERT INTO instructions (id, text) VALUES (48, '... <u>and</u> the <b>Comparison II template, page 35</b>');
INSERT INTO instructions (id, text) VALUES (49, 'Use <b>A Guide to Amplification, page 37,</b> to develop an amplification');
INSERT INTO instructions (id, text) VALUES (50, 'Use <b>Essay Four Arrangement B worksheets, pages 39-41,</b> to...');
INSERT INTO instructions (id, text) VALUES (51, 'Produce a <b>Basic Persuasive Essay Outline</b> with an Amplification (see template on <b>page 42</b>)');
INSERT INTO instructions (id, text) VALUES (52, 'Produce a <b>Basic Persuasive Essay Outline</b> from your ANI chart (like the one found on <b>page 28</b>)');
INSERT INTO instructions (id, text) VALUES (53, 'Produce an <b>Introductory Persuasive Essay Outline</b> from your ANI chart (like the one found on <b>page 15</b>)');
INSERT INTO instructions (id, text) VALUES (54, 'Produce a <b>Rudimentary Persuasive Essay Outline</b> from your ANI chart (like the one found on <b>page 6</b>)');
INSERT INTO instructions (id, text) VALUES (55, 'Using your issue from {items}...');
INSERT INTO instructions (id, text) VALUES (56, '... using <b>Parallelism II, page 43</b> to add parallel phrases or clauses');
INSERT INTO instructions (id, text) VALUES (57, 'Write your <b>Basic Persuasive Essay (Essay Four Checklist, page 111)</b> from your outline');
INSERT INTO instructions (id, text) VALUES (58, '... <u>and</u> the <b>Definition worksheet, page 51</b>');
INSERT INTO instructions (id, text) VALUES (59, 'Use <b>Arrangement: A guide to Division, page 53,</b> to add division to your outline');
INSERT INTO instructions (id, text) VALUES (60, 'Use <b>Essay Five Arrangement B worksheets, pages 55-57,</b> to...');
INSERT INTO instructions (id, text) VALUES (61, 'Produce a <b>Basic Persuasive Essay Outline</b> with Division (see template on <b>page 58</b>)');
INSERT INTO instructions (id, text) VALUES (62, 'Develop your exordium (p.24), amplification (p.37), and division (p.53)');
INSERT INTO instructions (id, text) VALUES (63, 'Write your <b>Basic Persuasive Essay (Essay Five Checklist, page 112)</b> from your outline');
INSERT INTO instructions (id, text) VALUES (64, '... using <b>Antithesis, page 59</b> to add parallel contrast');
INSERT INTO instructions (id, text) VALUES (65, '... the 5CT questions (p.9), Comparison I (p.23), and Comparison II (p.35)');
INSERT INTO instructions (id, text) VALUES (66, '... the 5CT questions (p.9), Comparison I (p.23), Comparison II (p.35), and Definition (p.51)');
INSERT INTO instructions (id, text) VALUES (67, '... <u>and</u> the <b>Circumstance exercises, page 65</b>');
INSERT INTO instructions (id, text) VALUES (68, 'Use <b>A Guide to Refutation, page 66,</b> to add the Refutation to your outline');
INSERT INTO instructions (id, text) VALUES (69, 'Use <b>Essay Six Arrangement B worksheets, pages 68-71,</b> to...');
INSERT INTO instructions (id, text) VALUES (70, 'Produce a <b>Basic Persuasive Essay Outline</b> with Refutation (see template on <b>page 72</b>)');
INSERT INTO instructions (id, text) VALUES (71, '... using Parallelism I (p.16-19), Verbs (p.29-31), and Parallelism II (p.43), and...');
INSERT INTO instructions (id, text) VALUES (72, 'Read Module {chapters}');
INSERT INTO instructions (id, text) VALUES (73, 'Do experiments {items} (choose one to do a Lab Notebook entry)');
INSERT INTO instructions (id, text) VALUES (74, 'Complete OYO {items} and Study Guide exercises');
INSERT INTO instructions (id, text) VALUES (75, 'Complete Module {chapters} test');
INSERT INTO instructions (id, text) VALUES (76, 'Do experiment {items} and Lab Notebook entry');
INSERT INTO instructions (id, text) VALUES (77, 'Read <b>only</b> pages {pages} of Module {chapters} {items}');
INSERT INTO instructions (id, text) VALUES (78, 'Read Module {chapters}, pages {pages}');
INSERT INTO instructions (id, text) VALUES (79, 'Do experiment {items} and Lab Notebook entry - record data');
INSERT INTO instructions (id, text) VALUES (80, 'Read "Student Notes" (Pages {pages})');
INSERT INTO instructions (id, text) VALUES (81, 'Read "{items}" (Pages {pages})');
INSERT INTO instructions (id, text) VALUES (83, '...NOTE: <b>Always</b> use the <b><u>factor-label method</u></b> even if you can work a problem an easier way or mentally.  The important thing is to master the factor-label method!');
INSERT INTO instructions (id, text) VALUES (84, 'Check answers to last week''s exercises if you didn''t already do so');
INSERT INTO instructions (id, text) VALUES (86, 'Highlight all of this unit''s timeline events that significantly involve this year''s geographic region (Africa, Asia (including the Middle East), and Australia)');
INSERT INTO instructions (id, text) VALUES (87, 'Choose your research topic for this unit (from the timeline and history events)');
